  <body><h1>浙江已报名参加首届全国智力运动会五子棋项目</h1><p><a href="../index.html">首页</a></p><p><a href="../forum/11.html">五子棋新闻</a></p><hr></hr><b>#1 浙江已报名参加首届全国智力运动会五子棋项目 作者：有志青年 发表时间：2009-5-28 7:18:26</b><br></br>首届全国智力运动会五子棋项目浙江省的参加人员是由浙江省五子棋专业委员会确定的，今天五子棋委员会已经上报了参与本次比赛的组别和人数。浙江将参与男子个人和女子个人以及混合团体三项全部比赛。<hr></hr></body>
